{'name': 'Popis', 'value': 'Nabízím k pronájmu velmi hezký byt 2+kk, 54m2 v ulici Velké Kunratické, ve velmi žádané lokalitě Praha 4,

Byt se nachází v 3. patře s výtahem a je částečně zařízen. Velká prostorná chodba, v ložnici velká vestavěná skříň se zrcadlem. V pokoji s kuchyní kuchyňská linka se sklokeramickou deskou a elektrickou troubou a lednicí. Okna plastová se žaluziemi. Koupelna s WC a vanou. Volný od 1.12. 2019.
Vzhledem k ceně a lokalitě doporučujeme'}

{'name': 'Popis', 'value': 'Exkluzivní nabídka luxusního bytu k\xa0pronájmu jen pár kroků od Václavského náměstí. Více nemovitostí naleznete na našich webových stránkách. Zrekonstruovaný dům\xa0má reprezentativní společné prostory, výtah na patře a odpovídá současným trendům moderního bydlení.

Byt je dispozičně řešený jako 3+1 a\xa0nachází se v šestém podlaží. Obývací pokoj a ložnice směřuje do ulice, druhá ložnice do tichého vnitrobloku. Dále je tady koupelna s vanou, dvěma umyvadly, toaletou a bidetem, a druhá koupelna se sprchovým koutem. Samozřejmostí je\xa0plně zařízená kuchyňská linka a vyhřívaná podlaha v koupelnách.

Z místa je skvělá dostupnost po celém centru Prahy i historické části města. V pěší dostupnosti se nachází\xa0k nákupům obchodní dům Quadrio či MY Tesco, skvělé restaurace a kavárny v blízkých uličkách a Františkánská zahrada ukrytá mezi bloky domů. Výborná dopravní dostupnost po Praze, pár metrů od bytu se nachází metro stanice Můstek a Národní třída. Pro více informací navštivte naše stránky nebo kontaktujte makléře.'}

{'name': 'Popis', 'value': 'Luxusně zařízený byt po rekonstrukci s balkonem, který Vám nabízíme, si zachoval své původní secesní architektonické detaily. Více nemovitostí naleznete na našich webových stránkách. Bydlení v prestižní lokalitě\xa0s\xa0blízkosti Staroměstského náměstí a Pařížské ulice nabízí maximální komfort centra města.

Byt je řešen dispozičně jako 2+1 a nachází se v čtvrtém patře. Je s plně vybavenou\xa0kuchyní v současném modernistickém duchu s jídelním prostorem se západní orientací.\xa0Interiér ohřívají funkční historická kamna. Ložnice s výhledem do vnitrobloku zajišťuje velkorysost bydlení\xa0volně stojící vířivka. Dále je v\xa0bytě umístěna koupelna se sprchovým koutem a toaletou, prádelna a vstupní hala. Ve vybavení bytu jsou původní svítidla, nové etážové topení, pračka, sušička, kuchyňské spotřebiče Bauknecht, kabelové připojení TV, WiFi internet, alarm, kamerový systém.

Lokalita Prahy 1 nabízí dostupnost nejluxusnějších restaurací a dostupnost historicky významných lokalit. Pro více informací navštivte naše webové stránky nebo kontaktujte makléře.\xa0'}

