{'name': 'Popis', 'value': 'Nabízíme krásný luxusní byt s výhledem do Pařížské ulice o dispozici 5+1 s balkónem. Více nemovitostí naleznete na našich webových stránkách. Historický dům s dochovanými secesními prvky je zrekonstruovaný, má krásné reprezentativní společné prostory, nový prosklený výtah na patře a odpovídá současným trendům moderního bydlení. Bydlení v prestižní lokalitě v\xa0blízkosti Staroměstského náměstí a Pařížské ulice.

Byt je řešen dispozičně jako 5+1 a nachází se v pátem patře, po kompletní rekonstrukci.\xa0Interiér tvoří 5 místnosti - moderní kuchyňská linka včetně špičkových zabudovaných spotřebičů, samostatná jídelna a útulný obývací pokoj. Dále je zde pracovna či pokoj pro hosty a dvě světlé ložnice. Je zde prostorná světlá koupelna a technická místnost pro pračku a sušičku. Samozřejmostí je samostatná toaleta pro hosty přístupná z haly.

Lokalita Prahy 1 nabízí dostupnost nejluxusnějších restaurací a historicky významných památek. Pro více informací navštivte naše webové stránky nebo kontaktujte makléře.'}

