{'name': 'Popis', 'value': 'Nabízíme Vám nově zrekonstruovaný designový byt situovaný v 2. podlaží secesního domu v žádané a atraktivní lokalitě Prahy 2 - Vinohrady. Více nemovitostí naleznete na našich webových stránkách. 

Byt, který lze využít i jako 4+1 o celkové výměře 140 m2 nabízí 2 samostatné ložnice a obývací pokoj, který je oddělen od kuchyně s jídelnou. Vstupní hala umožňuje dostatek úložných prostor, jedna z ložnic je orientována do vzhledného vnitrobloku a druhá do klidné ulice. Plně vybavená kuchyně disponuje spotřebiči Bosch a vkusně zařízenou jídelnou s výhledem do zahrady. Dále jsou zde k dispozici 2 koupelny se zařizovacími předměty Villeroy and Boch a 2 samostatné WC. Lze využívat privátní zahradu ve vnitrobloku s pískovištěm a sezením. Možnost pronájmu parkovacího stání.

Lukrativní lokalita nabízí veškerou občanskou vybavenost - obchody, kavárny, restaurace, divadla, školy, školky a výborné dopravní spojení do centra. V blízkosti se nachází oblíbené parky Folimanka, Havlíčkovy Sady nebo Riegrovy sady. Pro více informací navštivte naše stránky nebo kontaktujte makléře.'}
